function setErrorRepeatPassword(idSymbol, idInput) {
  const symbol = document.getElementById(idSymbol);
  const input = document.getElementById(idInput);

  symbol.setAttribute('class', idSymbol);
  input.setAttribute('class', `${idInput} -notNull`);
}

export default setErrorRepeatPassword;
